import React from "react";
import "./stamp.css";

const StampPads = () => {
  const printers = [
    {
      printer: "Printer C 10",
      size: "10 x 27 mm",
      packaging: "Packaging",
      handle: "E/10",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/images/products/b2.png", // Replace with actual image path
    },
    {
      printer: "Printer C 20",
      size: "14 x 38 mm",
      packaging: "Packaging",
      handle: "E/20",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/images/products/printer_c20.png", // Replace with actual image path
    },
    {
      printer: "Printer C 30",
      size: "18 x 47 mm",
      packaging: "Packaging",
      handle: "E/30",
      sparePad: "Spare Pad",
      optionalCover: "Optional: Cover",
      imgSrc: "/images/products/printer_c30.png", // Replace with actual image path
    },
  ];

  return (
    <div className="container pt-5">
      <div className="row">
        <div className="col-md-12">
          <h2 className="text-center mb-5">Our Stamp Printers</h2>
        </div>
        {printers.map((printer, index) => (
          <div key={index} className="col-md-4 mb-4">
            <div className="card stamp-card">
              <img
                src={printer.imgSrc}
                alt={printer.printer}
                className="card-img-top stamp-img"
              />
              <div className="card-body">
                <h5 className="card-title">{printer.printer}</h5>
                <ul className="list-unstyled">
                  <li><strong>Size:</strong> {printer.size}</li>
                  <li><strong>Packaging:</strong> {printer.packaging}</li>
                  <li><strong>Handle:</strong> {printer.handle}</li>
                  <li><strong>Spare Pad:</strong> {printer.sparePad}</li>
                  <li><strong>Optional Cover:</strong> {printer.optionalCover}</li>
                </ul>
                <button className="btn btn-primary">Buy Now</button>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default StampPads;
